import './Navigation.css';
import { NavLink } from 'react-router-dom';

function Navigation(props) {
  return (

       <div class='Navigation'>



        <ul className='Navigation__links'>
            <NavLink className='Navigation__link' activeClassName='Navigation__link_active' exact to='/'>Home</NavLink>
               <button onClick={props.onSigninClick} className='Navigation__link'>Saved Articles</button>
               <button onClick={props.onSigninClick} className='Navigation__link'>Username</button>

       </ul>
     </div>

        )
}

export default Navigation;
